  b 16.11.1958
  Christopher b. at Wellington. Pauline, d/o Ivan Peter Rogers and Dorothy May Voyce, b. at
  Rotherham. Address: 39 Bruce Avenue, Brooklyn, Wellington.
  Christopher was educated at St George's, Wanganui, Wanganui Collegiate School and Victoria
  University of Wellington (BA). He is a stained glass artist, photographer and writer. With his
  mother, he was co-author of "Waikanae - Past and Present" and with Dr JOC Phillips, he was
  co-author of "In the Light of the Past - Stained Glass in New Zealand Houses" and "The Sorrow and
  The Pride" about New Zealand war memorials. His most recent work includes "Tararua - The Story of a
  Mountain Range" (1994).
  Pauline was educated at Marlborough Girls' College and University of Canterbury and is a teacher.
